import React from 'react';
import { withStyles } from "@material-ui/styles";


const styles = {
  root: {
    background: "green"
  }
}

function ProjectDetailPage(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <h1>Project Detail Page</h1>
    </div>
  );

}

export default withStyles(styles)(ProjectDetailPage);
